import React, { useState } from "react";
// import { LocalizationProvider, CalendarPicker } from '@mui/lab';
import { LocalizationProvider,CalendarPicker } from '@mui/x-date-pickers';
import AdapterDateFns from '@mui/lab/AdapterDateFns';
import "./index.css"; // Importez votre fichier CSS
import { TextField } from "@mui/material";

const MyCalendar = () => {
  const [date, setDate] = useState(new Date());

  const handleDateChange = (newDate) => {
    setDate(newDate);
  };

  return (
    <div className="float-bloc">
      <div className="greet">
        <div className="title">Calendar</div>
        <div className="subtitle">Consultez votre calendrier</div>
      </div>
      <LocalizationProvider dateAdapter={AdapterDateFns}>
        <CalendarPicker
          date={date}
          onChange={handleDateChange}
          renderInput={(props) => <TextField {...props} />}
        />
      </LocalizationProvider>
    </div>
  );
};

export default MyCalendar;
